// ICT Session Validator - Enhanced kill zone detection
const inputData = $input.first().json;
const currentHour = new Date().getUTCHours();
const currentMinute = new Date().getUTCMinutes();
const currentTime = currentHour + (currentMinute / 60);

// ICT Kill Zones 2025 (GMT times)
const killZones = {
    Asian: { start: 0, end: 3, name: 'Asian_KZ', priority: 'MEDIUM', characteristics: 'Range-bound, low volatility' },
    London: { start: 7, end: 10, name: 'London_KZ', priority: 'HIGH', characteristics: 'Trend establishment, highest volatility' },
    NewYork: { start: 12, end: 14, name: 'NY_KZ', priority: 'HIGH', characteristics: 'Continuation moves, overlap energy' },
    LondonClose: { start: 15, end: 17, name: 'London_Close_KZ', priority: 'MEDIUM', characteristics: 'Retracement opportunities' }
};

let activeKillZone = 'Off_Hours';
let killZoneActive = false;
let currentZoneInfo = null;

for (const [zoneName, zone] of Object.entries(killZones)) {
    if (currentTime >= zone.start && currentTime < zone.end) {
        activeKillZone = zone.name;
        killZoneActive = true;
        currentZoneInfo = zone;
        break;
    }
}

// Enhanced session data
const enhancedData = {
    ...inputData,
    session_validation: {
        current_kill_zone: activeKillZone,
        kill_zone_active: killZoneActive,
        zone_priority: currentZoneInfo?.priority || 'LOW',
        zone_characteristics: currentZoneInfo?.characteristics || 'Outside trading hours',
        gmt_time: `${currentHour.toString().padStart(2, '0')}:${currentMinute.toString().padStart(2, '0')}`,
        trading_allowed: killZoneActive,
        session_strength: killZoneActive ? (activeKillZone.includes('London') || activeKillZone.includes('NY') ? 0.9 : 0.6) : 0.1
    }
};

return [{ json: enhancedData }];

// Enhanced ICT Analysis Parser with comprehensive error handling
const signalData = $input.first().json;
let aiResponseText;

try {
    // Get AI response with multiple fallback attempts
    const aiResponse = $('ICT AI Analysis').first().json;
    aiResponseText = aiResponse.message?.content || aiResponse.content || aiResponse.text;

    if (!aiResponseText) {
        throw new Error('No AI response content found');
    }

    // Parse AI analysis JSON with enhanced fallback
    let aiAnalysis;
    try {
        aiAnalysis = JSON.parse(aiResponseText);
    } catch {
        // Extract JSON from markdown or create fallback
        const jsonMatch = aiResponseText.match(/```(?:json)?\s*({[\s\S]*?})\s*```/);
        if (jsonMatch) {
            aiAnalysis = JSON.parse(jsonMatch[1]);
        } else {
            // Create ICT-informed fallback analysis
            aiAnalysis = {
                signal_quality: signalData.session_validation?.trading_allowed ? 'MEDIUM' : 'LOW',
                confidence_score: signalData.session_validation?.session_strength * 100 || 30,
                risk_level: signalData.session_validation?.zone_priority === 'HIGH' ? 'MEDIUM' : 'HIGH',
                recommendation: signalData.action || 'HOLD',
                reasoning: `Fallback ICT analysis - Session: ${signalData.session_validation?.current_kill_zone}`,
                stop_loss: parseFloat(signalData.price || 0) * 0.98,
                take_profit: parseFloat(signalData.price || 0) * 1.02,
                ict_analysis: {
                    session_alignment: signalData.session_validation?.trading_allowed || false,
                    session_strength: signalData.session_validation?.session_strength || 0.1,
                    structure_break: 'NONE',
                    liquidity_grab: false,
                    fair_value_gap: false,
                    order_block_present: false,
                    kill_zone_active: signalData.session_validation?.kill_zone_active || false,
                    institutional_sentiment: 'NEUTRAL',
                    entry_model: 'Fallback',
                    session_quality: signalData.session_validation?.zone_priority || 'LOW'
                }
            };
        }
    }

    // Enhance with session data
    if (aiAnalysis.ict_analysis) {
        aiAnalysis.ict_analysis = {
            ...aiAnalysis.ict_analysis,
            current_kill_zone: signalData.session_validation?.current_kill_zone,
            zone_characteristics: signalData.session_validation?.zone_characteristics,
            gmt_time: signalData.session_validation?.gmt_time
        };
    }

    // Create final enhanced signal
    const enhancedSignal = {
        ...signalData,
        ai_analysis: aiAnalysis,
        coinbase_data: $('Get Coinbase Market Data').first()?.json || {},
        enhanced_metadata: {
            processing_time: new Date().toISOString(),
            workflow_version: '3.0_ICT_2025',
            ai_model: 'gpt-4o',
            ict_session: signalData.session_validation?.current_kill_zone,
            session_valid: signalData.session_validation?.trading_allowed || false,
            analysis_quality: 'ENHANCED'
        }
    };

    return [{ json: enhancedSignal }];

} catch (error) {
    console.error('ICT Analysis parsing error:', error);

    return [{
        json: {
            ...signalData,
            ai_analysis: {
                signal_quality: 'LOW',
                confidence_score: 0,
                risk_level: 'HIGH',
                recommendation: 'HOLD',
                reasoning: `Analysis error: ${error.message}`,
                stop_loss: null,
                take_profit: null,
                ict_analysis: {
                    session_alignment: false,
                    session_strength: 0,
                    structure_break: 'ERROR',
                    error: true,
                    current_kill_zone: signalData.session_validation?.current_kill_zone || 'Unknown'
                }
            },
            error: {
                type: 'ICT_PARSING_ERROR',
                message: error.message,
                timestamp: new Date().toISOString()
            }
        }
    }];
}
